import React from "react";
import "./App.css";
import AuthProvider from "./provider/authProvider";
import Routes from "./routes";
import NavBar from "./NavBar";
import { Nav } from "reactstrap";
function App() {
  return (
    <AuthProvider>
      <NavBar />
      <Routes />
    </AuthProvider>
  );
}

export default App;
